import { LoginHeader} from "../LoginPage/LoginHeader";


function SearchBox() {
    return (
        <div className="searchBox" >
            <p> Search Album Here: </p>
            <input type='text'></input>
        </div>
    )
}

function SearchPage() {
    return (
        <div className="searchPage">
            <LoginHeader/>
            <SearchBox />
        </div>
    )
}


export default SearchPage;
